import React from "react";
import "../styles.css";
import { Link } from "react-router-dom";

function Homepage() {
  return (
    <div>
      <h1 style={{ color: "#004cff", fontSize: "30" }}>인뱅</h1>
      <h2 style={{ color: "#004cff" }}>In-Bang</h2>
      <p style={{ color: "#004cff" }}>
        Are you ready to watch exciting movies? Click the box below to get you
        started!
      </p>
      <Link to="/login">
        <button
          style={{
            backgroundColor: "#1200b8",
            color: "white",
            padding: "5px",
          }}
        >
          Get Started >
        </button>
      </Link>
    </div>
  );
}

export default Homepage;
